for morphometric and meristic data. Scale-row reductions match holotype with minor variation (Appendix). Slight indication of longer heads in males (
Table 2
), but sample size small; little difference in relative tail length but males only sex to have up to 6 subcaudals. Shape of tail shield in posterior view fairly consistently similar to holotype . Colour pattern generally matches holotype with minor variation. For example: last two ( CAS 226014, 225902 ) or four ( CAS 225967 ) ventrals entirely pale, or with brown flecks ( CAS 226015 ); anals flecked in CAS 225690, 225967 ; middorsal zigzag broken into patches anteriorly in WHT 5243 , CAS 225690 and 225967 ; contrast between paler and darker regions stronger in some specimens (e.g., WHT 5284 ); scales between infralabials brown in CAS 225690, 225967 226015 ; brown spots not clear on prefrontals of CAS 225690 ; tail shield more orange than brown in CAS 226014 , more yellow in WHT 5284 .
